const title = `体验微前端`;
const content = "\"---\\nsidebar_position: 2\\ntitle: 体验微前端\\n---\\n# 体验微前端\\n\\n通过本章你可以了解到：\\n\\n- 如何创建微前端项目的主应用、子应用。\\n- 微前端项目开发的基本流程。\\n\\n## 创建应用\\n\\n在这次的实践中，我们需要创建三个应用，分别为 1 个主应用，2 个子应用：\\n\\n- main 主应用\\n- dashboard 子应用\\n- table 子应用\\n\\n### 创建 main 主应用\\n\\n通过命令行工具初始化项目：\\n\\n```bash\\nmkdir main && cd main\\nnpx @modern-js/create\\n```\\n\\nimport DefaultMWAGenerate from \\\"@site-docs/components/default-mwa-generate\\\";\\n\\n<DefaultMWAGenerate />\\n\\n完成项目创建后我们可以通过 `pnpm run new` 来开启 `微前端` 功能：\\n\\n```bash\\n? 请选择你想要的操作 启用可选功能\\n? 启用可选功能 启用「微前端」模式\\n```\\n\\n接下来，让我们注册微前端插件并添加开启微前端主应用，并增加子应用列表：\\n\\nimport EnableMicroFrontend from \\\"@site-docs/components/enable-micro-frontend\\\";\\n\\n<EnableMicroFrontend />\\n\\nimport MicroRuntimeConfig from \\\"@site-docs/components/micro-runtime-config\\\";\\n\\n<MicroRuntimeConfig />\\n\\n### 创建 dashboard 子应用\\n\\n通过命令行工具初始化项目：\\n\\n```bash\\nmkdir dashboard && cd dashboard\\nnpx @modern-js/create\\n```\\n\\n按照如下选择，生成项目：\\n\\n<DefaultMWAGenerate/>\\n\\n我们执行 `pnpm run new` 来开启 `微前端` 功能：\\n\\n```bash\\n? 请选择你想要的操作 启用可选功能\\n? 启用可选功能 启用「微前端」模式\\n```\\n\\n接下来，让我们注册微前端插件并修改 `modern.config.ts`，添加微前端子应用的配置 `deploy.microFrontend`：\\n\\n```js title=\\\"modern.config.ts\\\"\\nimport appTools, { defineConfig } from '@modern-js/app-tools';\\nimport garfishPlugin from '@modern-js/plugin-garfish';\\n\\nexport default defineConfig({\\n  runtime: {\\n    router: true,\\n    state: true,\\n  },\\n  deploy: {\\n    microFrontend: true,\\n  },\\n  plugins: [appTools(), garfishPlugin()],\\n});\\n```\\n\\n### 创建 table 子应用\\n\\n通过命令行工具初始化项目：\\n\\n```bash\\nmkdir table && cd table\\nnpx @modern-js/create\\n```\\n\\n按照如下选择，生成项目：\\n\\n<DefaultMWAGenerate/>\\n\\n我们执行 `pnpm run new` 来开启 `微前端`：\\n\\n```bash\\n? 请选择你想要的操作 启用可选功能\\n? 启用可选功能 启用「微前端」模式\\n```\\n\\n接下来，让我们注册微前端插件并修改 `modern.config.ts`，添加微前端子应用的配置 `deploy.microFrontend`：\\n\\n```js title=\\\"modern.config.ts\\\"\\nimport appTools, { defineConfig } from '@modern-js/app-tools';\\nimport garfishPlugin from '@modern-js/plugin-garfish';\\n\\nexport default defineConfig({\\n  runtime: {\\n    router: true,\\n    state: true,\\n  },\\n  deploy: {\\n    microFrontend: true,\\n  },\\n  plugins: [appTools(), garfishPlugin()],\\n});\\n```\\n\\n## 添加代码\\n\\n### main 主应用\\n\\n删除 `src/routers` 目录, 创建 `src/App.tsx`，并添加如下内容：\\n\\n```tsx\\nimport { Link } from '@modern-js/runtime/router';\\nimport { useModuleApps } from '@modern-js/plugin-garfish/runtime';\\n\\nconst App = () => {\\n  const { DashBoard, TableList } = useModuleApps();\\n  return (\\n    <div>\\n      <div>\\n        <Link to=\\\"/dashboard\\\">Dashboard</Link> &nbsp;\\n        <Link to=\\\"/table\\\">Table</Link>\\n      </div>\\n      <Route path=\\\"/dashboard\\\">\\n        <DashBoard />\\n      </Route>\\n      <Route path=\\\"/table\\\">\\n        <TableList />\\n      </Route>\\n    </div>\\n  );\\n};\\n\\nexport default App;\\n```\\n\\n### dashboard 子应用\\n\\n删除 `src/routers` 目录, 创建 `src/App.tsx`，并添加如下内容：\\n\\n```tsx\\nexport default () => <div>Dashboard Page</div>;\\n```\\n\\n### table 子应用\\n\\n删除 `src/routers` 目录, 创建 `src/App.tsx`，并添加如下内容：\\n\\n```tsx\\nexport default () => <div>Table Page</div>;\\n```\\n\\n## 调试\\n\\n按顺序在 `main`、 `dashboard`、 `table` 目录执行 `pnpm run dev` 命令启动应用：\\n\\n- main - `http://localhost:8080`\\n- dashboard - `http://localhost:8081`\\n- table - `http://localhost:8082`\\n\\n访问主应用地址 `http://localhost:8080`，效果如下：\\n\\n![demo](https://lf3-static.bytednsdoc.com/obj/eden-cn/zq-uylkvT/ljhwZthlaukjlkulzlp/micro-demo.gif)\\n\\n在完成了微前端整体开发流程的体验后，你可以进一步了解如何 [开发主应用](./c03-main-app.md)\\n\\n## 常见问题\\n\\n自查手册: https://www.garfishjs.org/issues/\\n\"";
